// MyChart.js
import React from 'react';
import { Bar } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, Title);

const MyChart = ({ data }) => {
  const chartData = {
    labels: data.map(item => item.title), // Extract titles or any other relevant property
    datasets: [
      {
        label: 'Some Data', // Change to relevant data label
        data: data.map(item => item.value), // Extract values to plot
        backgroundColor: 'rgba(75, 192, 192, 0.6)', // Adjust color as needed
        borderColor: 'rgba(75, 192, 192, 1)',
        borderWidth: 1,
      },
    ],
  };

  return (
    <div>
      <h2>My Chart</h2>
      <Bar data={chartData} />
    </div>
  );
};

export default MyChart;
